// import logo from './logo.svg';
import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
// import { Link } from 'react-router-dom';
import SignUpPage from './Components/Signup/Signuppage';
import LandingPage from './Components/LandingPage/landingpage';
import LoginPage from './Components/Login/login';
import DashboardPage from './Components/Dashboard/dashboard';
import SPDashboardPage from './Components/Dashboard/dashboardsp';
import CSTRDashboardPage from './Components/Dashboard/dashboardcstr';
import SpProfilePage from './Components/ServiceProvider/SpProfile/SpProfilePage';
import SpSideNavbar from './Components/ServiceProvider/SPSideNavbar/SPSideNavbar';
import UpcomingBookings from './Components/ServiceProvider/Bookings/UpcomingBookings';

function App() {
  return (
  <Router>
    <div className="App">
      <header className="App-header">
        <Routes>
            <Route path="/" element={<LandingPage />} />
            <Route path="/login" element={<LoginPage />} />
            <Route path="/signup" element={<SignUpPage />} />
            <Route path="/dashboard" element={<DashboardPage />} />
            <Route
              path="/spdashboard"
              element={
                <SPDashboardPage>
                  <SpSideNavbar />
                  <Routes>
                    <Route path="/" element={<UpcomingBookings />} />
                    {/* Add other routes for SPDashboard here */}
                  </Routes>
                </SPDashboardPage>
              }
            />
            <Route path="/cstrdashboard" element={<CSTRDashboardPage />} />
            <Route path="/spprofilepage" element={<SpProfilePage />} />
        </Routes>
      {/* 
      <Link to="/signup">Sign Up Page</Link>
        <Router>
        <Routes>
        <Route path='/signup' element={<SignUpPage/>} />
      </Routes>
      </Router> */}
      </header>
    </div>
    </Router>
  );
}

export default App;
